pragma solidity ^0.8.0;

import "./Book.sol";
import "./Client.sol";

contract MyLibrary {
    mapping(address => Client) public clients;
    mapping(uint256 => Book) public libraryBooks;
    uint256 nrBooks = 0;

    // struct ClientBook{
    //     Client client;
    //     Book book[];
    // }
